(defn find-gaps []
  (let [later [0x0f 0x26 0x2e 0x36 0x3e 0x64 0x65 0x66 0x67 0xf2 0xf3]
        used (set (concat (map first (keys all-decode-examples)) later (map #(vector (first %) (second %)) (keys all-decode-examples))))]
    (concat (mapv #(format "%02x" %) (filter #(not (used %)) (range 256)))
            (mapv #(format "%02x %02x" (first %) (second %)) (filter #(not (used %)) (map #(vector 0x0f %) (range 256)))))))


(defn first-examples [examples]
  (sort-by first
           (vals (reduce #(assoc %1 (first %2) %2)
                         {}
                         (reverse (sort (keys all-decode-examples)))))))


(deftest signed-byte-test
  (is (= 0 (signed-byte 0)))
  (is (= 0x7f (signed-byte 0x7f)))
  (is (= -0x80 (signed-byte 0x80)))
  (is (= -1 (signed-byte 0xff))))


(deftest signed-word-test
  (is (= 0 (signed-word 0)))
  (is (= 0x7fff (signed-word 0x7fff)))
  (is (= -0x8000 (signed-word 0x8000)))
  (is (= -1 (signed-word 0xffff))))


(deftest byte-to-word-test
  (is (= 0 (byte-to-word 0)))
  (is (= 0x7f (byte-to-word 0x7f)))
  (is (= 0xff80 (byte-to-word 0x80)))
  (is (= 0xffff (byte-to-word 0xff))))


(deftest decode-test
  (doseq [br (sort-by (comp ::i/tag second) all-decode-examples)]
    (let [expected (when (br 1) (assoc (br 1) ::i/length (count (br 0))))
          bytes (conj (br 0) 0xff 0x00 0xff)]
      (is (= expected (decode bytes)) (mapv #(format "%02x" %) (br 0))))))
